'use strict';

const fs = require('fs');
const { Stream } = require('stream');

process.stdin.resume();
process.stdin.setEncoding('utf-8');

let inputString = '';
let currentLine = 0;

process.stdin.on('data', function (inputStdin) {
    inputString += inputStdin;
});

process.stdin.on('end', function () {
    inputString = inputString.split('\n');

    main();
});

function readLine() {
    return inputString[currentLine++];
}

function generateNucleotideLengthMap(gene) {
    var nucleotideLengthMap = { A: 0, C: 0, G: 0, T: 0 };
    for (let curNucId = 0; curNucId < gene.length; curNucId++) {
        nucleotideLengthMap[gene[curNucId]]++;
    }
    return nucleotideLengthMap;
}

function generateExtraNucleotideLengthMap(nucleotideLengthMap, optimalLength) {
    var extraNucleotideLengthMap = {};
    var nucleotides = ['A', 'C', 'G', 'T'];
    nucleotides.forEach(nucleotide => {
        if (nucleotideLengthMap[nucleotide] > optimalLength) {
            extraNucleotideLengthMap[nucleotide] = nucleotideLengthMap[nucleotide] - optimalLength;
        }
    })
    return extraNucleotideLengthMap;
}

function lengthOfSmallestSequenceToReplace(gene, extraNucleotideLengthMap) {

    let smallestSequenceLength = gene.length;
    let extraNucleotidesPresent = Object.keys(extraNucleotideLengthMap);


    const totalNucleotidesToReplace = extraNucleotidesPresent.reduce((curVal, nucleotide) => {
        return curVal + extraNucleotideLengthMap[nucleotide];
    }, 0)


    for (let i = 0; i + totalNucleotidesToReplace < gene.length; i++) {
        let curNucleotide = gene[i];
        let seqIndex = i;
        if (i % 1000 == 0) { console.log(i) }
        while (extraNucleotidesPresent.includes(curNucleotide) != true) {
            curNucleotide = gene[seqIndex++];
        }
        let seqStart = i;
        let enp_copy = [...extraNucleotidesPresent]; //extra nucletides present
        let extraNucleotideLengthMap_copy = { ...extraNucleotideLengthMap };

        while (enp_copy.length != 0 && seqIndex < gene.length) {
            curNucleotide = gene[seqIndex];
            if (enp_copy.includes(curNucleotide)) {
                extraNucleotideLengthMap_copy[curNucleotide]--;
                if (extraNucleotideLengthMap_copy[curNucleotide] == 0) {
                    let nucleotideIndex = enp_copy.indexOf(curNucleotide);
                    enp_copy.splice(nucleotideIndex, 1);
                }
            }
            seqIndex++
        }


        if (enp_copy.length > 0) { continue; }

        let subSequenceLength = seqIndex - seqStart;
        if (subSequenceLength < smallestSequenceLength) {
            smallestSequenceLength = subSequenceLength;
            i = seqIndex;
        }



    }

    return smallestSequenceLength;

}
function steadyGene(str) {
    const freqs = { A: 0, C: 0, G: 0, T: 0 };
    for (const ch of str) freqs[ch]++;
    let i = 0, j = 0, min = Infinity, l4 = str.length / 4;
    while (i < str.length && j < str.length) {
        if (['A', 'C', 'G', 'T'].some(ch => freqs[ch] > l4)) {
            freqs[str[j]]--, j++;
        } else {
            min = Math.min(min, j - i);
            freqs[str[i]]++, i++;
        }
    }
    return min;
}

